import { useEffect } from "react";
import {
    Routes,
    Route,
    useNavigationType,
    useLocation,
  } from "react-router-dom";
import Root from "./pages/root";

function App() {
  return (
    <Routes>
      <Route path="/" element={<Root />} />
    </Routes>
  );
}
export default App;
